Mitigating MongoDB injection attacks with Mongoose<p>I'm using the <a href="https://mongoosejs.com/" rel="noreferrer">Mongoose ODM wrapper</a> for NodeJS and I'm concerned about injection attacks. Let's assume I have the following schema:</p>

<pre class="lang-js prettyprint-override"><code>const UserSchema = new mongoose.Schema({ userName: String, password: String });
</code></pre>

<p>If I were to perform a login request that looks like the following:</p>

<pre class="lang-js prettyprint-override"><code>router.post('/login', (request, response) =&gt; {

    const userName = request.body.userName;
    const password = request.body.password;

    User.findOne({ userName: userName }, function (error, user) {
        // ... check password, other logic
    });
});
</code></pre>

<p>I would be open to an injection attack with the following JSON payload which will always find a user:</p>

<pre class="lang-js prettyprint-override"><code>{
    "email": { "$gte": "" },
    "password": { "$gte": "" }
}
</code></pre>

<p>I'm not concerned about the password as it is hashed if a user is found which prevents any actual log in but I want to make sure my input is sanitized so that an attacker wouldn't even make it to that point.</p>

<p>I'm aware of the <a href="https://www.npmjs.com/package/mongo-sanitize" rel="noreferrer">mongo-sanitize</a> NPM package referenced in a similar <a href="https://stackoverflow.com/questions/28710345/sanitize-user-input-in-mongoose">StackOverflow post</a> which appears to remove all JSON keys that begin with '$'. I plan on using this anyway but I will never allow the user to submit raw, unparsed JSON. Is it good practice in that case to just call toString() on the userName assuming I do the correct <code>null</code> checks? </p>

<pre class="lang-js prettyprint-override"><code>const userName = request.body.userName.toString();
</code></pre>

<p>That would eliminate the query from being executed but it doesn't feel very secure. I assume the following is a better approach as it tries to convert <code>userName</code> to a <code>String</code>:
</p>

<pre><code>User.findOne({ userName: { "$eq": userName } }, function (error, user) {
     // ... other logic
});
</code></pre>

<p>I can't find anything concerning this in the in the <a href="https://mongoosejs.com/docs/api.html#model_Model.findOne" rel="noreferrer">Model.findOne() documentation</a> which leads me to believe I'm overlooking something.</p>

<p>Any insight would be appreciated.</p>

<p><strong>Other References:</strong></p>

<ol>
<li><a href="https://blog.websecurify.com/2014/08/hacking-nodejs-and-mongodb.html" rel="noreferrer">https://blog.websecurify.com/2014/08/hacking-nodejs-and-mongodb.html</a></li>
<li><a href="https://ckarande.gitbooks.io/owasp-nodegoat-tutorial/content/tutorial/a1_-_sql_and_nosql_injection.html" rel="noreferrer">https://ckarande.gitbooks.io/owasp-nodegoat-tutorial/content/tutorial/a1_-_sql_and_nosql_injection.html</a></li>
</ol>

