How to convert a field, which is an array of objects with K-V pairs to array of arrays with only values?<p>I have a collection in MongoDB which has a field called <strong>"geometry"</strong> with latitude and longitude like this :</p>

<pre><code>{ 
    "abc":"xyz",
    "geometry" : [
        {
            "lat" : 45.0, 
            "lng" : 25.0
        }, 
        {
            "lat" : 46.0, 
            "lng" : 26.0
        }
    ]
}
</code></pre>

<p>I want to convert the field <strong>geometry</strong> into something like this, to be compliant with the GeoJSON format:</p>

<pre><code>{
            "abc":"xyz",
            "geometry": {
            "type": "LineString",
                "coordinates": [
                    [
                        25.0,
                        45.0
                    ],
                    [
                        26.0,
                        46.0
                    ]
                ]                
            }
}
</code></pre>

<p>The operation essentially involves taking an array of objects with two K/V pairs and pick only the values and store them as array of arrays(with the order reversed- so value of "lng" comes first).</p>

<p><strong><em>My failed attempts:</em></strong> 
I tried using an aggregate and tried to project the following:</p>

<pre><code>"geometry": {"type":"LineString", "coordinates":["$points.lng","$points.lat"] }
</code></pre>

<p>which gave me a result similar to: </p>

<pre><code>"geometry": {
        "type": "LineString",
            "coordinates": [
                [
                    25.0,
                    26.0
                ],
                [
                    45.0,
                    46.0
                ]
            ]                
        }
</code></pre>

<p>I've tried working with this and modifying data record by record, but the results are not consistent. And, I'm trying to avoid going through every record and changing the structure one by one. Is there a way to do this efficiently ?</p>

