how to make aggregrate function dynamic using params in express and mongoose<p>I am using aggregate function in mongoose to fetch some data, here its static implementation</p>

<pre><code>app.get("/male",function (req,res) {
  Record.aggregate([
    {
      $match: 
      {"gender": "male"}
    },
      {
         $group:{ 
            _id : "$type",
             total : {$sum : 1}
        }
      },{
      $sort: {_id: 1}
    }
      ]).exec((err,data) =&gt; {
            if (err) {console.log(err)} 

            res.json(data)

        })

})
</code></pre>

<p>I wanna make it completely dynamic so i tried this</p>

<pre><code>  app.get("/:query/:type/:match",function (req,res) {

  var match = req.params.match

  Record.aggregate([
    {
      $match: 
      {match : req.params.type}
    },
      {
         $group:{ 
            _id : "$"+req.params.query,
             total : {$sum : 1}
        }
      },{
      $sort: {_id: 1}
    }
      ]).exec((err,data) =&gt; {
        if (err) {console.log(err)}

              res.json(data)

        })

})
</code></pre>

<p>I debugged it little bit ,it appears that <strong>match</strong> is not passing in <strong>$match</strong>,</p>

<p>if i put static variable instead of match it works</p>

<p>Here its scheema</p>

<pre><code>   var mongoose = require('mongoose');

   var RecordSchema = new mongoose.Schema({

      type:String,
      gender:String,
      age:Number,
      timeSpent:Number,
      arrivedAt:Number

   })

   module.exports = mongoose.model("Record", RecordSchema);
</code></pre>

